import React from "react";
import { Container, Row } from "react-bootstrap";
import "./HomePage.css";

const HomePage = () => {
  return (
    <div className="main">
      <Container>
        <Row>HomePage</Row>
      </Container>
    </div>
  );
};

export default HomePage;
